import { apiConfig } from '../../config';

const { baseUrl, apiKey } = apiConfig.spoonacular;

export const fetcher = async (url: string) => {
  const modifiedUrl = `${baseUrl}${url}?apiKey=${apiKey}`;
  const res = await fetch(modifiedUrl);
  return res.json();
};
